import React from "react";

const Child = ({ name, fruitList, setFruit }) => {
  const newFruit = () => {
    const addFruit = [...fruit, "Orange"];
    setFruit(addFruit);
  };

  return (
    <div>
      <h1>{name}</h1>
      <h2>Fruits:</h2>
      <ul>
        {fruitList.map((fruit, index) => (
          <li key={index}>{fruit}</li>
        ))}
      </ul>
      <button onClick={newFruit}></button>
    </div>
  );
};

export default Child;
